member.example:
This sample shows how to call GenSecurityAsync.

var credential = new AzureKeyCredential("<key>");
var client = new SecurityClientClient(credential);

Response response = await client.GenSecurityAsync();
Console.WriteLine(response.Status);

This sample shows how to call GenSecurity.

var credential = new AzureKeyCredential("<key>");
